  false,\n\t\"url\": null,\n\t\"notes\": \"The environmental contaminants program
  at the U.S. Fish and Wildlife Service Ecological Services Office in Cheyenne, Wyoming
  was initiated in May 1988. The goal of the environmental contaminants program is
  to protect and improve the quality of fish and wildlife resources by: identifying
  environmental contaminants problems affecting fish and wildlife resources; preventing
  environmental contaminants from adversely affecting fish and wildlife resources;
  correcting environmental contaminant problems; and assisting in the restoration
  of fish and wildlife habitats adversely impacted by environmental contaminants.
  This assessment of environmental contaminants issues in the state was conducted
  to facilitate long-term planning of the program. Information presented in this report
  is also intended to provide a concise overview of contaminants issues to U.S. Fish
  and Wildlife Service (FWS) managers at the Regional and Washington offices. Major
  activities that pose or may pose contaminant risks to fish and wildlife resources
  in Wyoming include: mining illegal pesticide use hazardous materials sites irrigation
  return-flows oilfield waste pits oilfield produced waters Superfund sites evaporation
  ponds The strategy for protecting and improving the quality of fish and wildlife
  resources in Wyoming involves continued public outreach to increase awareness of
  environmental contaminants; increase coordination with EPA and the Wyoming Dept.
  of Environmental Quality on assessment of Resource Conservation and Recovery Act
  (RCRA) and Superfund sites; work with the private sector in a cooperative manner
  to resolve contaminants problems; provide technical assistance to the FWS's Law
  Enforcement agents in their efforts to enforce the Migratory Bird Treaty Act. Updates
  are planned for this document as additional information becomes available and other
  contaminant issues are identified.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
